extern "C" int printf(const char *format, ...);

class A {
public:
  A() {}
  virtual int f();
  virtual int g();
  virtual int h(...);
  virtual ~A() {}

public:
  bool necessary_field;
};

class B : public A {
public:
  B() : A() {}
  virtual ~B() {}
};

class C : public virtual B {
public:
  C() : B() {}
  ~C();
};

class D : public virtual B {
public:
  D() : B() {}
  ~D();
  virtual int g();
  virtual int h(...);
};

class E {
public:
  virtual int f();
  virtual int g();
  virtual int h(...);
  virtual ~E(){};
};

class F : public C, public D, public virtual E {
  ~F();
};

class G : public virtual E, public C, public D {
  ~G();
};

C::~C() {}
D::~D() {}
F::~F() {}
G::~G() {}
int E::f() { return 1; }
int A::f() { return 0; }
int E::g() { return 1; }
int A::g() { return 0; }
int D::g() { return 0; }

int E::h(...) { return 1; }
int A::h(...) { return 0; }
int D::h(...) { return 0; }

int main() {
  A *ans = new C();
  delete ans;

  B *b = new D();
  b->f();
  b->g();
  b->h(1,2,3);
  b = new C();
  b->f();
  b->h(1,2,3);
  b = new C();
  b->f();
  b->h(1,2,3);
  b = new F();
  b->f();
  b->g();
  b->h(1,2,3);

  ans = new B();
  delete ans;

  ans = new F();
  ans->f();
  ans->g();
  ans->h(1,2,3);
  delete ans;

  E *e = new F();
  e->f();
  e->g();
  e->h(1,2,3);
  delete e;
  e = new G();
  e->f();
  e->g();
  e->h(1,2,3);
  delete e;
}

